@tonga: What happens when your messaging infrastructure is not available? 
For cacheable responses, a HTTP cache in between the sender and receiver can respond when the receiver is unavailable.
Otherwise the [Circuit Breaker pattern](http://springinpractice.com/2010/07/06/annotation-based-circuit-breakers-with-spring) is a viable (and preferable) alternative, especially considering the chain-of-custody problem that asynchronous messaging presents (literally last week I had to help manage yet another production incident because a receiver could not process an asynchronous message).

