I'm currently changing the initialization of the COM objects in my library using a temporary thread like this:

`std::thread t{[&comPointer] {
CoInitializeEx(nullptr, COINIT_MULTITHREADED);
CoCreateInstance(/* Initialize comPointer */);
}};
t.join();`

This is working fine so far and allows clients to use my objects in any thread they like. Not sure if there are any drawbacks?

